import React from 'react'
const Test = (props) => {
    const counter = 0
    const questionsArray = [
        {
        rightAnswerId : 3,
        questions: {
          question: 'Сколько континентов?',
          answers: [
            {text:5,id:1},
            {text:10,id:2},
            {text:3,id:3},
            {text:4,id:4}]
        }
      }
    ] 
    const renderQuestion = () => {
        questionsArray.map(question => {
            <>
            <h2 className="test-header">{question.question}</h2>
      <ul className="button-container">
        <li className="button-option">{question.answers[0]}</li>
        <li className="button-option">{question.answers[1]}</li>
        <li className="button-option">{question.answers[2]}</li>
        <li className="button-option">{question.answers[3]}</li>
      </ul> 
      </>
        })
    }
return(
    <div className="test-container">
       {renderQuestion} 
    </div>
)
}
export default Test
